jQuery(document).ready(function(){
		if(localStorage.getItem('PICKUP_POST')=='none') {
		}else{
				set_pickup('#pickup-alarm-additional');
		}
});
function set_pickup(element){
		$(element).addClass('active');
		$(element+' span').html('   cookie.  <br> <a href="/privacy-policy/" rel="nofollow">      </a>');
		localStorage.setItem('PICKUP_POST', 'active');
		return false;
}
function close_pickup(element){
		$(element).addClass('none');
		$(element+' span').html('');
		$(element).removeClass('active');
		localStorage.setItem('PICKUP_POST', 'none');
		return false;
}
